import './App.css';
import "./style.css";
import Header from './components/header';
import Routes from './routes';
import { BrowserRouter, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
          <Header />
          <nav id="main-nav" class="blue-grey">
            <ul class="">
              <li><Link className="menu black-text" to={`/`}>Home</Link></li>
              <li><Link className="menu black-text" to={`/register-client`}>Cadastro</Link></li>
              <li><Link className="menu black-text" to={`/list-client`}>Consulta</Link></li>
              <li><Link className="menu black-text" to={`/about`}>Sobre</Link></li>
            </ul>
          </nav>
          <Routes/>
        </BrowserRouter>
    </div>
  );
}

export default App;
